children.text:
body { margin: 16px; font-family: Arial, sans-serif; }
table { 
  border-collapse: separate; 
  border-spacing: 0; 
  margin-bottom: 30px;
}
th, td { 
  padding: 8px 12px; 
  border: 1px solid #666; 
  background: #fff; 
}
thead th { background: #f0f0f0; }
caption { caption-side: top; font-weight: bold; margin-bottom: 8px; }

.auto-width { table-layout: auto; }
.fixed-width { table-layout: fixed; width: 600px; }
.percentage-width { width: 80%; }

.narrow { width: 50px; }
.wide { width: 200px; }
